var logoData="data:image/png;base64,";

MyLoaderScene = cc.Scene.extend({
    _interval : null,
    _label : null,
    _logo : null,
    _className:"MyLoaderScene",
    cb: null,
    target: null,
    _processLayer:null,
    _processLayerLength:null,
    /**
     * Contructor of MyLoaderScene
     * @returns {boolean}
     */
    init : function(){
        var self = this;

        //logo
        var logoWidth = 160;
        var logoHeight = 200;

        // bg
        var bgLayer = self._bgLayer = new cc.LayerColor(cc.color(32, 32, 32, 255));
        self.addChild(bgLayer, 0);

        //image move to CCSceneFile.js
        var fontSize = 24, lblHeight =  -logoHeight / 2 + 100;
        if(logoData){
            //loading logo
            cc.loader.loadImg(logoData, {isCrossOrigin : false }, function(err, img){
                logoWidth = img.width;
                logoHeight = img.height;
                self._initStage(img, cc.visibleRect.center);
            });
            fontSize = 14;
            lblHeight = -logoHeight / 2 - 10;
        }
        //loading percent
        var label = self._label = new cc.LabelTTF("玩命加载中... 0%", "Arial", fontSize);
        label.setPosition(cc.pAdd(cc.visibleRect.center, cc.p(0, lblHeight)));
        label.setColor(cc.color(180, 180, 180));
        bgLayer.addChild(this._label, 10);

        // 进度条
        this._winSize = cc.director.getWinSize();
		var centerPos = cc.p(this._winSize.width / 2, this._winSize.height / 2);
		self._processLayerLength = 500;
		self._processLayer = cc.LayerColor.create(cc.color(10, 211, 240, 155), 1, 30);
		self._processLayer.setPosition(cc.pAdd(centerPos, cc.p(- this._processLayerLength / 2, -logoHeight / 2 - 60)));
 
		self._bgLayer.addChild(this._processLayer);		

        return true;
    },

    _initStage: function (img, centerPos) {
        var self = this;
        var texture2d = self._texture2d = new cc.Texture2D();
        texture2d.initWithElement(img);
        texture2d.handleLoadedTexture();
        var logo = self._logo = new cc.Sprite(texture2d);
        logo.setScale(cc.contentScaleFactor());
        logo.x = centerPos.x;
        logo.y = centerPos.y;
        self._bgLayer.addChild(logo, 10);
    },
    /**
     * custom onEnter
     */
    onEnter: function () {
        var self = this;
        cc.Node.prototype.onEnter.call(self);
        self.schedule(self._startLoading, 0.3);
    },
    /**
     * custom onExit
     */
    onExit: function () {
        cc.Node.prototype.onExit.call(this);
        var tmpStr = "Loading... 0%";
        this._label.setString(tmpStr);
    },

    /**
     * init with resources
     * @param {Array} resources
     * @param {Function|String} cb
     * @param {Object} target
     */
    initWithResources: function (resources, cb, target) {
        if(cc.isString(resources))
            resources = [resources];
        this.resources = resources || [];
        this.cb = cb;
        this.target = target;
    },

    _startLoading: function () {
        var self = this;
        self.unschedule(self._startLoading);
        var res = self.resources;
        cc.loader.load(res,
            function (result, count, loadedCount) {
                var percent = (loadedCount / count * 100) | 0;
                percent = Math.min(percent, 100);
                self._label.setString("玩命加载中...  " + percent + "%");
                self._processLayer && self._processLayer.changeWidth(self._processLayerLength * percent / 100);
            }, function () {
                if (self.cb)
                    self.cb.call(self.target);
            });
    },

    _updateTransform: function(){
        this._renderCmd.setDirtyFlag(cc.Node._dirtyFlags.transformDirty);
        this._bgLayer._renderCmd.setDirtyFlag(cc.Node._dirtyFlags.transformDirty);
        this._label._renderCmd.setDirtyFlag(cc.Node._dirtyFlags.transformDirty);
        this._logo && this._logo._renderCmd.setDirtyFlag(cc.Node._dirtyFlags.transformDirty);
        this._processLayer && this._processLayer._renderCmd.setDirtyFlag(cc.Node._dirtyFlags.transformDirty);
    }
});

MyLoaderScene.preload = function(resources, cb, target){
    var _cc = cc;
    if(!_cc.myLoaderScene) {
        _cc.myLoaderScene = new MyLoaderScene();
        _cc.myLoaderScene.init();
        cc.eventManager.addCustomListener(cc.Director.EVENT_PROJECTION_CHANGED, function(){
            _cc.myLoaderScene._updateTransform();
        });
    }
    _cc.myLoaderScene.initWithResources(resources, cb, target);

    cc.director.runScene(_cc.myLoaderScene);
    return _cc.myLoaderScene;
};